import { useEffect, useState } from "react";
import { getLogs } from "../api";

export default function Dashboard() {
  const [logs, setLogs] = useState([]);

  useEffect(() => {
  const email = localStorage.getItem("email");

  if (email) {
    getLogs(email).then(res => {
      setLogs(res.data);
    });
  }
}, []);


  return (
    <div className="dashboard">
  <h1>üìä Dashboard</h1>
  <p className="subtitle">Your uploaded log reports</p>

  <div className="card-container">
    {logs.map((log, i) => (
      <div className="card" key={i}>
        <h3>{log.fileName}</h3>
        <p>‚ùå Errors: {log.errorCount}</p>
        <p>‚ö†Ô∏è Warnings: {log.warningCount}</p>
        <p>üìå Status: {log.status}</p>
      </div>
    ))}
  </div>
</div>

  );
}
